  false,\n\t\"url\": null,\n\t\"notes\": \"This data file contains compressed versions
  of physical- chemicalnoceanographic data collected using electronic CTD and STD
  recorders.nThese data were collected in the Norwegian sea from February to Apriln1982.
  These data were collected from the CSS HUDSON. The next data setndata were collected
  in the Southern ocean and Southern Atlantic on thenKNORR from October 1983 to February
  1984 as part of the AJAX expedition.nLEG I of the cruise is under reference number
  L00064; Leg II is undernL00065. Both the data sets were submitted by Arnold Mantyla
  from ScrippsnInstitute of Oceanography (SIO). The data are in Oceanographic StationnData
  (SD2) format. Follow the URL:nhttp://www.nodc.noaa.gov/General/NODC-Archive/sd2.html
